import React from 'react';
import './Navbar.css';

const navbar = () =>{
  return(
      <nav className="navbar--content">
        <span>PvE</span>
        <span>Fractals</span>
        <span><i class="fal fa-chess-rook"></i><br />WvW</span>
        <span><i className="fal fa-search fa-2x"></i></span>
      </nav>
  );
}

export default navbar;
